import React from 'react'
import NormalPost from '../../../Pages/Post/NormalPost'
import Post6Block from '../../../Pages/Post/Post6Block'
import SpecialPost from '../../../Pages/Post/SpecialPost'
import styles from './HomeContainer.module.css'


export default function HomeContainer (props) {
    return (
        <div className={styles.homeContainer}>
            <div className={styles.post6Block}>
                {props.posts.map((params,id)=>(
                    // <Post6Block key={id} id={id++} post={params}/>
                    <div key={id} id={id++} post={params}>
                        {props.id === 0 || props.id === 5 ? <SpecialPost post={props.post}/> : <NormalPost post={props.post}/>}
                    </div>
                ))}
            </div>
            
        </div>
    )
}
